const t=JSON.parse('{"key":"v-dd45ff08","path":"/Travel_in_Cryptography/02-symmetrc-cryptography.html","title":"2.对称加密算法","lang":"zh-CN","frontmatter":{"title":"2.对称加密算法","date":"2023-03-20T22:43:59.000Z","icon":"file-lines","category":["CTF Learning","密码学旅行日志 - Travel in Cryptography"],"description":"对称加密算法 DES Data Encryption Standard是上世纪70年代开始广泛采用的对称加密算法。 DES的加密过程是将64bit的明文用56bit的密钥加密生成64bit的密文，解密过程恰好相反。因为加密解密使用的是相同的密钥，所以称为“对称加密算法”。 在加密的过程中，明文会经历多次加密变成密文，每次称为“一轮”，下面详细地介绍一下过程。 第一轮：输入64bit的明文，均分为左右两侧，各32bit。 右32bit发送至轮函数，轮函数根据右32bit和此轮的密钥来生成一个神秘的32bit数据 左32bit与刚刚生成的神秘32bit数据异或运算，作为输出的左侧 输入的右侧32bit不处理，直接作为输出右侧 后续的轮：对调输入的左右32bit数据，各轮分别使用新的密钥，与第一轮类似处理。 最后一轮：同之前的轮，输出后的结果不再对调，作为最终结果。","head":[["meta",{"property":"og:url","content":"https://someijam.github.io/SomeiWiki/SomeiWiki/Travel_in_Cryptography/02-symmetrc-cryptography.html"}],["meta",{"property":"og:site_name","content":"SomeiWiki"}],["meta",{"property":"og:title","content":"2.对称加密算法"}],["meta",{"property":"og:description","content":"对称加密算法 DES Data Encryption Standard是上世纪70年代开始广泛采用的对称加密算法。 DES的加密过程是将64bit的明文用56bit的密钥加密生成64bit的密文，解密过程恰好相反。因为加密解密使用的是相同的密钥，所以称为“对称加密算法”。 在加密的过程中，明文会经历多次加密变成密文，每次称为“一轮”，下面详细地介绍一下过程。 第一轮：输入64bit的明文，均分为左右两侧，各32bit。 右32bit发送至轮函数，轮函数根据右32bit和此轮的密钥来生成一个神秘的32bit数据 左32bit与刚刚生成的神秘32bit数据异或运算，作为输出的左侧 输入的右侧32bit不处理，直接作为输出右侧 后续的轮：对调输入的左右32bit数据，各轮分别使用新的密钥，与第一轮类似处理。 最后一轮：同之前的轮，输出后的结果不再对调，作为最终结果。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2023-11-07T08:49:20.000Z"}],["meta",{"property":"article:author","content":"Someijam"}],["meta",{"property":"article:published_time","content":"2023-03-20T22:43:59.000Z"}],["meta",{"property":"article:modified_time","content":"2023-11-07T08:49:20.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"2.对称加密算法\\",\\"image\\":[\\"\\"],\\"datePublished\\":\\"2023-03-20T22:43:59.000Z\\",\\"dateModified\\":\\"2023-11-07T08:49:20.000Z\\",\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"Someijam\\",\\"url\\":\\"https://blog.someijam.cn\\",\\"email\\":\\"lingsomeijam1@outlook.com\\"}]}"]]},"headers":[{"level":2,"title":"DES","slug":"des","link":"#des","children":[]},{"level":2,"title":"三重DES","slug":"三重des","link":"#三重des","children":[]},{"level":2,"title":"AES","slug":"aes","link":"#aes","children":[]},{"level":2,"title":"对明文的分组操作","slug":"对明文的分组操作","link":"#对明文的分组操作","children":[{"level":3,"title":"ECB：","slug":"ecb","link":"#ecb","children":[]},{"level":3,"title":"CBC：","slug":"cbc","link":"#cbc","children":[]},{"level":3,"title":"其他明文分组操作","slug":"其他明文分组操作","link":"#其他明文分组操作","children":[]}]}],"git":{"createdTime":1699346960000,"updatedTime":1699346960000,"contributors":[{"name":"Someijam","email":"lingsomeijam1@outlook.com","commits":1}]},"readingTime":{"minutes":6.84,"words":2052},"filePathRelative":"Travel_in_Cryptography/02-symmetrc-cryptography.md","localizedDate":"2023年3月20日","excerpt":"<h1> 对称加密算法</h1>\\n<h2> DES</h2>\\n<p>Data Encryption Standard是上世纪70年代开始广泛采用的对称加密算法。</p>\\n<p>DES的加密过程是将64bit的明文用56bit的密钥加密生成64bit的密文，解密过程恰好相反。因为加密解密使用的是相同的密钥，所以称为“对称加密算法”。</p>\\n<p>在加密的过程中，明文会经历多次加密变成密文，每次称为“一轮”，下面详细地介绍一下过程。</p>\\n<ul>\\n<li>\\n<p>第一轮：输入64bit的明文，均分为左右两侧，各32bit。</p>\\n<p>右32bit发送至轮函数，轮函数根据右32bit和此轮的密钥来生成一个神秘的32bit数据</p>\\n<p>左32bit与刚刚生成的神秘32bit数据异或运算，作为输出的左侧</p>\\n<p>输入的右侧32bit不处理，直接作为输出右侧</p>\\n</li>\\n<li>\\n<p>后续的轮：对调输入的左右32bit数据，各轮分别使用新的密钥，与第一轮类似处理。</p>\\n</li>\\n<li>\\n<p>最后一轮：同之前的轮，输出后的结果不再对调，作为最终结果。</p>\\n</li>\\n</ul>","autoDesc":true}');export{t as data};
